import React from "react";
import Container from '@material-ui/core/Container';

import axios from 'axios'



class Post extends React.Component {
	state = {
	  posts: {}
	};

	componentDidMount() {
	  const postID = this.props.match.params.postID;
	  axios.get(`http://127.0.0.1:8000/api/post/${postID}/`).then(res => {
		this.setState({
		  posts: res.data
		});
	  });
	}

   render(){
	return (
		<Container component="main" maxWidth="md">

			<br/>
			<div >
				<Container maxWidth="sm">
					<h4>
						<span>{this.state.posts.Gene}</span>
						<span>{this.state.posts.Protein_Effect}</span>
						<span>{this.state.posts.Impact}</span>
						<span>{this.state.posts.Variant_Description}</span>

						<span>{this.state.posts.Associated_with_drug_Resistance}</span>
					</h4>

				</Container>
			</div>
		</Container>
	);
   }

}


export default Post
